import axios from 'axios'
import { BrowserRouter as Router, Route } from 'react-router-dom'


function Body() {

    useEffect(() => getData(), [])

    let [articles, setArticles] = useState()

    function getData() {
        axios.get('http://localhost:5000/articles')
            .then(
                response => {
                    setArticles(response.data)
                }
            )
    }

    return (
        <div>

        </div>
    )
}


export default Body;
